import React from "react";
import { useNavigate } from "react-router-dom";
import './Home.css';

const Home = (props) => {
  const navigate = useNavigate();

  return (
    <div>
        <div heading>
            <h1>Home Page</h1>
        </div>
        <p>Go to the contact page by using one of the following:</p>
        <hr />

        {/* Button */}
        <p>
            <button onClick={() => navigate("/contact")}>Go to Contact</button>
        </p>
    </div>
  );
};

export default Home;
